import React from 'react';
import './FindPlayers.css'; // Create the corresponding CSS file for styling

const FindPlayers = () => {
  return (
    <div className="find-players-container">
      {/* Location Selector */}
      <div className="location-selector">
        <span className="location-icon">üìç</span> Hyderabad
      </div>

      {/* Text Section */}
      <div className="text-section">
        <h1>FIND PLAYERS & VENUES NEARBY</h1>
        <p>
          Seamlessly explore sports venues and play with sports enthusiasts just like you!
        </p>
      </div>

      {/* Images Section */}
      <div className="images-section">
        <img src="basketball.jpg" alt="Basketball" className="main-image" />
        <div className="sub-images">
          <img src="badminton.jpg" alt="Badminton" className="sub-image" />
          <img src="football.jpg" alt="Football" className="sub-image" />
        </div>
      </div>
    </div>
  );
};

export default FindPlayers;
